import axios from "axios";

const CONCERTAPIBASEURL = "http://localhost:59612/api/Authentication";

class AuthenticationService {
  authentication(request) {
    return axios.post(CONCERTAPIBASEURL + "/authenticate", request);
  }

  register(request) {
    return axios.post(CONCERTAPIBASEURL, request);
  }
}

export default new AuthenticationService();
